import ItemCard from './ItemCard';

const Item = () =>{


 const [magicitems, setItem] = useState([])
      useEffect(() => {
        axios.get('http://localhost:5000/api/magicitems')
      .then(response => {
            console.log(response.data.results);
            setItem(response.data.results);
  })
      .catch(error => {
             console.log(error);
  });
}, []);
return (
    <div class= "cardwrap">
        <p>{magicitems}</p>
    </div>
    )
}
export default Item;
